from hypothesis import given, strategies as st
import re
from pandas.core.dtypes.inference import is_re_compilable


@given(
    pattern=st.one_of(
        st.text(alphabet=st.characters(blacklist_categories=('Cs',)), min_size=0, max_size=10),
        st.integers(),
        st.floats(),
        st.none(),
    )
)
def test_is_re_compilable_consistent_with_re_compile(pattern):
    result = is_re_compilable(pattern)

    try:
        re.compile(pattern)
        can_compile = True
    except (TypeError, re.error):
        can_compile = False

    if can_compile:
        assert result, f"is_re_compilable({pattern!r}) returned False but re.compile succeeded"


if __name__ == "__main__":
    import sys
    try:
        test_is_re_compilable_consistent_with_re_compile()
        print("Hypothesis test passed!")
    except Exception as e:
        print(f"Hypothesis test failed: {e}")
        sys.exit(1)

from pandas.core.dtypes.inference import is_re_compilable
import re

# Test the exact cases mentioned in the bug report
test_cases = ["(", ")", "?", "*", "["]

for pattern in test_cases:
    print(f"Testing pattern: {pattern!r}")
    try:
        result = is_re_compilable(pattern)
        print(f"  Result: {result}")
    except re.error as e:
        print(f"  ERROR: re.error: {e}")
    except re.PatternError as e:
        print(f"  ERROR: re.PatternError: {e}")
    except Exception as e:
        print(f"  ERROR: {type(e).__name__}: {e}")

    # Compare with what re.compile does directly
    print(f"  Direct re.compile test:")
    try:
        re.compile(pattern)
        print(f"    re.compile succeeded")
    except (TypeError, re.error) as e:
        print(f"    re.compile failed with {type(e).__name__}: {e}")
